INSERT INTO ROOM (NAME, INFO) VALUES ('Зал № 1', 'Зал со звуком долби диджитал, и поддержкой формата  4D. Кресла оборудованы турбоподдувом.');
INSERT INTO ROOM (NAME, INFO) VALUES ('Зал № 2', 'Зал с красным занавесом и полом с черно-белым паркетом. Однорукий человек, встретит вас у дверей.');
INSERT INTO ROOM (NAME, INFO) VALUES ('Зал № 3', 'Зал-ретро. Чапаев в нем возможно не умирает.');
INSERT INTO ROOM (NAME, INFO) VALUES ('Зал № 4', 'Зал с мягкими диванами для компаний. И местами у столиков.');
INSERT INTO ROOM (NAME, INFO) VALUES ('Зал № 5', 'Зал с одним удобным креслом.');
INSERT INTO EVENT (NAME, INFO) VALUES ('Унесенные ветром', 'Могучие ветры Гражданской войны в один миг уносят беззаботную юность южанки Скарлетт О`Хара, когда привычный шум балов сменяется грохотом канонад на подступах к родному дому. Для молодой женщины, вынужденной бороться за новую жизнь на разоренной земле, испытания и лишения становятся шансом переосмыслить идеалы, обрести веру в себя и найти настоящую любовь.');
INSERT INTO EVENT (NAME, INFO) VALUES ('Крокодил Данди', 'Американская журналистка приезжает в глубинку Австралии, и охотник на крокодилов знакомит ее с местными достопримечательностями. Она же приглашает его в Нью-Йорк, и там отважный охотник попадает в неведомые ему джунгли…');
INSERT INTO EVENT (NAME, INFO) VALUES ('Люди под лестницей', 'Обыкновенный тринадцатилетний мальчик вступил в жуткое жилище. Тот кошмар, который пришлось испытать герою, невозможно описать словами.');
INSERT INTO EVENT (NAME, INFO) VALUES ('Ребенок Розмари', 'Однажды Розмари видит странное видение, будто она плывет на яхте с Гаем, который превращается в демона и насилует её. Через несколько дней девушка узнает, что беременна. Череда странных событий наталкивает Розмари на догадку, что их соседи — члены сатанинского культа.');
INSERT INTO EVENT (NAME, INFO) VALUES ('Выпускник', 'После окончания колледжа в дом своих родителей в Лос-Анджелесе возвращается Бенджамен Брэддок. Начинается бесконечная череда дружеских визитов. Все хотят посмотреть на выпускника! На одном из приемов Бен знакомится с приятельницей своих родителей, элегантной дамой бальзаковского возраста миссис Робинсон.');
INSERT INTO EVENT (NAME, INFO) VALUES ('Бонни и Клайд', 'Молодые и отчаянные любовники Бонни и Клайд легко и изящно грабят банки в 30-е годы XX века. Но их романтизм и «робингудство» довольно быстро перерастают в лужи и реки крови, в хаос и грязь смерти, а судьба пророчит им неудачу…');
